import { API } from "../../../backend"


export const createCategory = category => {
    return fetch(`${API}/admin/create/category`, {
        method: "POST",
        headers: {
            Accept: "application/json",
            "Content-Type": "application/json"
        },
        body: JSON.stringify(category)
    }).then(data => {
        if (data.err) {
            console.log(data.err)

        } else {
            console.log(data)

        }
    })
}
